// SPDX-License-Identifier:GPL-3.0

pragma solidity ^0.8.17;

contract LearnStructs {
    struct Movie {
        string title;
        string director;
        uint id;
    }
    Movie movie;

    constructor () {
        movie = Movie("xcad", "sdfa", 12);
    }

    function getMovie () public view returns (Movie memory) {
        return movie;
    }


    struct Tv {
        string title;
        string director;
        uint id;
        string[] maker;
    }
    Tv public tv;

    // 将一个memory的结构体赋值给storage的结构体, 实际上是浅拷贝
    function test() public returns (Tv memory, Tv memory) {
        Tv memory t = Tv("test", "aaa", 19, new string[](1));
        t.maker[0] = "zhangsan";
        tv = t;
        // 这里
        t.maker[0] = "lisi";
        t.title = "title1";

        return  (tv, t);

        // return (t.maker, t.title, tv.maker, tv.title)
    }
}

